import React from 'react';
import Nav from "./Nav";
import Side from "./SideNav";
import {Switch,Route} from "react-router-dom";
import Csr from "./Csr";

function App() {
  return (
    <>

    <Side/>
    <Nav/>

    <Switch>

      <Route exact path="/csr" component={Csr} />

    </Switch>
    </>
  );
}

export default App;
